('Add Blog Category','2022-02-24 10:35:03.858837','2020-05-28 13:51:53.157256','Administrator','Administrator',0,0,'Add Blog Category',0,0,NULL,NULL,'Create Entry',NULL,'Blog Category',0,0,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
('Create Blogger','2022-02-24 10:35:03.872590','2020-04-30 19:06:10.694419','Administrator','Administrator',0,0,'Create Blogger',0,0,NULL,NULL,'Create Entry',NULL,'Blogger',0,0,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
('Custom Doctype','2022-02-24 10:35:11.643050','2021-11-23 12:30:04.407568','Administrator','Administrator',0,0,'Custom Document Types',0,0,'A DocType (Document Type) is used to insert forms in ERPNext. Forms such as Customer, Orders, and Invoices are Doctypes in the backend. You can also create new DocTypes to create new forms in ERPNext as per your business needs.',NULL,'Create Entry','Learn more about creating new DocTypes','DocType',1,1,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
('Custom Field','2022-02-24 10:35:11.602605','2021-11-23 12:21:09.479808','Administrator','Administrator',0,0,'Create Custom Fields',0,0,'Every form in ERPNext has a standard set of fields. If you need to capture some information, but there is no standard Field available for it, you can insert Custom Field for it.\n\nOnce custom fields are added, you can use them for reports and analytics charts as well.\n',NULL,'Create Entry','Learn how to add Custom Fields','Custom Field',1,1,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
('Enable Website Tracking','2022-02-24 10:35:03.866064','2020-04-30 20:22:50.778590','Administrator','Administrator',0,0,'Enable Website Tracking',0,0,NULL,NULL,'Update Settings',NULL,'Website Settings',0,0,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'enable_view_tracking','1',NULL,NULL,NULL,NULL,NULL),
('Introduction to Website','2022-02-24 10:35:03.888887','2020-05-28 13:51:51.485924','Administrator','Administrator',0,0,'Introduction to Website',0,0,NULL,NULL,'Watch Video',NULL,NULL,0,0,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,'https://www.youtube.com/watch?v=lyW6mfFBSNw',NULL,NULL,NULL,NULL),
('Naming Series','2022-02-24 10:35:11.636590','2021-11-24 15:04:14.662684','Administrator','Administrator',0,0,'Setup Naming Series',0,0,'Each document created in ERPNext can have a unique ID generated for it, using a prefix defined for it. Though each document has some prefix pre-configured, you can further customize it using tools like Naming Series Tool and Document Naming Rule.\n',NULL,'Watch Video',NULL,NULL,0,0,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'https://youtu.be/IGyISSfI1qU',NULL,NULL,NULL,NULL),
('Print Format','2022-02-24 10:35:11.629394','2021-11-23 15:04:12.728513','Administrator','Administrator',0,0,'Customize Print Formats',0,0,'Print Formats allow you can define looks for documents when printed or converted to PDF. You can also create a custom Print Format using drag-and-drop tools.',NULL,'Create Entry','Learn about Standard and Custom Print Formats','Print Format',1,1,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
('Report Builder','2022-02-24 10:35:11.615977','2021-11-24 17:04:18.762838','Administrator','Administrator',0,0,'Generate Custom Reports',0,0,'In each module, you will find a host of single-click reports, ranging from financial statements to sales and purchase analytics and stock tracking reports. If a required new report is not available out-of-the-box, you can create custom reports in ERPNext by pulling values from the same multiple ERPNext tables.\n',NULL,'Watch Video','Learn more about Report Builders','Report',0,0,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'https://youtu.be/TxJGUNarcQs',NULL,NULL,NULL,NULL),
('Role Permissions','2022-02-24 10:35:11.621891','2021-11-24 15:04:14.615232','Administrator','Administrator',0,0,'Setup Limited Access for a User',0,0,'In ERPNext, you can add your Employees as Users, and give them restricted access. Tools like Role Permission and User Permission allow you to define rules which give restricted access to the user to masters and transactions.',NULL,'Watch Video',NULL,NULL,0,0,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'https://youtu.be/g3mk45o1zAg',NULL,NULL,NULL,NULL),
('Web Page Tour','2022-02-24 10:35:03.880389','2020-05-28 13:51:54.264456','Administrator','Administrator',0,0,'Learn about Web Pages',0,0,NULL,NULL,'Show Form Tour',NULL,'Web Page',0,0,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
('Workflows','2022-02-24 10:35:11.609214','2021-11-24 15:04:14.632144','Administrator','Administrator',0,0,'Setup Approval Workflows',0,0,'Workflows allow you to define custom rules for the approval process of a particular document in ERPNext. You can also set complex Workflow Rules and set approval conditions.',NULL,'Watch Video',NULL,NULL,0,0,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,1,NULL,NULL,'https://youtu.be/yObJUg9FxFs',NULL,NULL,NULL,NULL);
