('Classic','2022-02-24 10:35:27.249726','2017-08-18 00:43:48.675833','Administrator','Administrator',0,1,'Classic',0,1,'/*\n	common style for whole page\n	This should include:\n	+ page size related settings\n	+ font family settings\n	+ line spacing settings\n*/\n.print-format div,\n.print-format span,\n.print-format td,\n.print-format h1,\n.print-format h2,\n.print-format h3,\n.print-format h4 {\n	font-family: Georgia, serif;\n}\n\n/* classic format: for-test */','/assets/frappe/images/help/print-style-classic.png',NULL,NULL,NULL,NULL),
('Modern','2022-02-24 10:35:27.264504','2020-11-10 13:59:09.976381','Administrator','Administrator',0,1,'Modern',0,1,'.print-heading {\n	text-align: right;\n	text-transform: uppercase;\n	color: #666;\n	padding-bottom: 20px;\n	margin-bottom: 20px;\n	border-bottom: 1px solid #d1d8dd;\n}\n\n.print-heading h2 {\n	font-size: 24px;\n}\n\n.print-format th {\n	background-color: #eee !important;\n	border-bottom: 0px !important;\n}\n\n.print-format .primary.compact-item {\n    font-weight: bold;\n}\n\n/* modern format: for-test */','/assets/frappe/images/help/print-style-modern.png',NULL,NULL,NULL,NULL),
('Monochrome','2022-02-24 10:35:27.242273','2017-08-18 00:44:25.023898','Administrator','Administrator',0,0,'Monochrome',0,1,'.print-format * {\n	color: #000 !important;\n}\n\n.print-format .alert {\n	background-color: inherit;\n	border: 1px dashed #333;\n}\n\n.print-format .table-bordered,\n.print-format .table-bordered > thead > tr > th,\n.print-format .table-bordered > tbody > tr > th,\n.print-format .table-bordered > tfoot > tr > th,\n.print-format .table-bordered > thead > tr > td,\n.print-format .table-bordered > tbody > tr > td,\n.print-format .table-bordered > tfoot > tr > td {\n	border: 1px solid #333;\n}\n\n.print-format hr {\n	border-top: 1px solid #333;\n}\n\n.print-heading {\n	border-bottom: 2px solid #333;\n}\n','/assets/frappe/images/help/print-style-monochrome.png',NULL,NULL,NULL,NULL),
('Redesign','2022-02-24 10:35:27.257541','2020-12-14 17:56:37.421390','Administrator','Administrator',0,0,'Redesign',0,1,'.print-format {\n    font-size: 13px;\n    background: white;\n}\n\n.print-heading {\n    border-bottom: 1px solid #f4f5f6;\n    padding-bottom: 5px;\n    margin-bottom: 10px;\n}\n\n.print-heading h2 {\n    font-size: 24px;\n}\n\n.print-heading h2 div {\n    font-weight: 600;\n}\n\n.print-heading small {\n    font-size: 13px !important;\n    font-weight: normal;\n    line-height: 2.5;\n    color: #4c5a67;\n}\n\n.print-format .letter-head {\n    margin-bottom: 30px;\n}\n\n.print-format label {\n    font-weight: normal;\n    font-size: 13px;\n    color: #4C5A67;\n    margin-bottom: 0;\n}\n\n.print-format .data-field {\n    margin-top: 0;\n    margin-bottom: 0;\n}\n\n.print-format .value {\n    color: #192734;\n    line-height: 1.8;\n}\n\n.print-format .section-break:not(:last-child) {\n    margin-bottom: 0;\n}\n\n.print-format .row:not(.section-break) {\n    line-height: 1.6;\n    margin-top: 15px !important;\n}\n\n.print-format .important .value {\n    font-size: 13px;\n    font-weight: 600;\n}\n\n.print-format th {\n    color: #74808b;\n    font-weight: normal;\n    border-bottom-width: 1px !important;\n}\n\n.print-format .table-bordered td, .print-format .table-bordered th {\n    border: 1px solid #f4f5f6;\n}\n\n.print-format .table-bordered {\n    border: 1px solid #f4f5f6;\n}\n\n.print-format td, .print-format th {\n    padding: 10px !important;\n}\n\n.print-format .primary.compact-item {\n    font-weight: normal;\n}\n\n.print-format table td .value {\n    font-size: 12px;\n    line-height: 1.8;\n}\n',NULL,NULL,NULL,NULL,NULL);
